export default function userReducer(state, action) {
  switch (action.type) {
    case "updateName":
      state[0].name = "Bekir";

      let data = fetch("https://exampleapi.com/products")
        .then((res) => res.json())
        .then((res) => {
          if (res.error) {
            throw res.error;
          }

          return res.products;
        })
        .catch((error) => {});

      console.log(state);
      return [...state];
    default:
      return state;
  }
}
